import styled from "styled-components";

const LandingStyled = styled.div`
  background-image: url("../../images/landingpagebg.jpg");
  height: 100vh;
  width: 100%;
`;
const LandingPage = () => {
  return <LandingStyled>hello</LandingStyled>;
};

export default LandingPage;
